        _.extend(this, d3c.seriesCharts());

        var parsedData = parseDateBasedCsv(rawCsv);

        var root = removeChildrenOf(d3.select("#amount-of-commits-by-committer1"));

        var margin = {top: 20, right: 80, bottom: 30, left: 50};
        var uiConfig = {
            width: styleWidthOf(root) - margin.left - margin.right,
            height: 500 - margin.top - margin.bottom,
            margin: margin,
            color: d3.scale.category10()
        };
        var description = helpDescription("What does this chart show?",
                "This chart shows amount of commits by people who committed the most. " +
                "The idea is to see who and when made biggest impact on project. " +
                "(Please avoid this chart if someone might want to attribute amount of commits to personal 'performance'.)" +
                "<br/><strong>Tip:</strong>&nbsp;alt+click checkboxes to exclude committers."
        );

        var svgRoot = root.append("svg")
                .attr("width", uiConfig.width + uiConfig.margin.left + uiConfig.margin.right)
                .attr("height", uiConfig.height + uiConfig.margin.top + uiConfig.margin.bottom)
                .append("g")
                .attr("transform", "translate(" + uiConfig.margin.left + "," + uiConfig.margin.top + ")");

        var seriesData =
                withSeriesData(
                        autoGroupOnFirstUpdate(100,
                                withMinMaxKey(withMinMaxOfRow(
                                        groupedBy(d3time([d3.time.monday, d3.time.month]),
                                                withFirstCategories(5, withCategoryExclusion(
                                                        newDataSource(parsedData, "date")
                                                )))))));
        var x = newTimeScale("date").nice().rangeRound([0, uiConfig.width]);
        var y = newScale("value").range([uiConfig.height, 0]);
        var xAxis = newXAxis(svgRoot, x, uiConfig);
        var yAxis = newYAxis(svgRoot, y).label("Amount of commits");
        var lineSeries = newLineSeries(svgRoot, x, y, uiConfig);

        var controlsPanel = newControlsPanel(root, uiConfig);
        addHelpButton(controlsPanel.leftFooter(), svgRoot, uiConfig, description,
                "", {tooltipPad: -20});
        newDropDown(controlsPanel, "Interpolation:", ["basis", "linear"], 0, function(value) {
            lineSeries.setInterpolation(value === "0" ? "basis" : "linear");
        });
        var groupBy = newGroupByDropDown(controlsPanel, seriesData, "Group by:", ["week", "month"]);
        var wordsPanel = newWordsPanel(controlsPanel, lineSeries, seriesData);
        var nothingToShowLabel = newEmptyChartLabel(root, svgRoot, uiConfig);

        seriesData.onUpdate([
            x.update, y.update, groupBy.update,
            lineSeries.update, xAxis.update, yAxis.update, wordsPanel.update,
            nothingToShowLabel.update
        ]);
        x.onUpdate([lineSeries.onXScaleUpdate, xAxis.onXScaleUpdate]);
        lineSeries.onUpdate(wordsPanel.onLineSeriesUpdate);

        seriesData.sendUpdate();
    })();


    function newWordsPanel(root, lineSeries, dataSource) {
        var hiddenCategories = [];

        var wordPanel = root.append("span");
        wordPanel.append("label").html("Committers: ");
        var wordsSpan = wordPanel.append("span");
        wordPanel.append("button").text("Reset").on("click", function() {
            dataSource.clearCategoryExclusions();
        });

        var it = {};
        it.update = function(update) {
            wordsSpan.selectAll(".word").remove();

            var word = wordsSpan.selectAll(".word")
                    .data(update.seriesData).enter()
                    .append("span")
                    .attr("class", "word");

            word.on("mouseover", function(d) {
                lineSeries.setSelectedCategory(d.category);
            });
            word.on("mouseout", function() {
                lineSeries.setSelectedCategory(null);
            });

            word.append("input").attr("type", "checkbox")
                    .attr("checked", function(it) { return _.contains(hiddenCategories, it.category) ? null : ""; })
                    .on("click", function(it) {
                        if (d3.event.altKey) {
                            dataSource.excludeCategory(it.category);
                        } else {
                            var visible = this.checked;
                            lineSeries.setCategoryVisible(it.category, visible);
                            if (visible) {
                                hiddenCategories = _.without(hiddenCategories, it.category);
                            } else {
                                hiddenCategories.push(it.category);
                            }
                        }
                    });
            word.append("label").html(function(d){ return "&nbsp;" + d.category; });
        };
        it.onLineSeriesUpdate = function() {
            hiddenCategories.forEach(function(it) {
                lineSeries.setCategoryVisible(it, false);
            });
        };
        return it;
    }

        _.extend(this, d3c.seriesCharts());

        var parsedData = parseDateBasedCsv(rawCsv);

        var root = removeChildrenOf(d3.select("#amount-of-commits-by-committer2"));

        var margin = {top: 20, right: 80, bottom: 30, left: 50};
        var uiConfig = {
            width: styleWidthOf(root) - margin.left - margin.right,
            height: 500 - margin.top - margin.bottom,
            margin: margin,
            color: d3.scale.category10()
        };
        var description = helpDescription("What does this chart show?",
                "This chart shows amount of commits by people who committed the most. " +
                "The idea is to see who and when made biggest impact on project. " +
                "(Please avoid this chart if someone might want to attribute amount of commits to personal 'performance'.)" +
                "<br/><strong>Tip:</strong>&nbsp;alt+click checkboxes to exclude committers."
        );

        var svgRoot = root.append("svg")
                .attr("width", uiConfig.width + uiConfig.margin.left + uiConfig.margin.right)
                .attr("height", uiConfig.height + uiConfig.margin.top + uiConfig.margin.bottom)
                .append("g")
                .attr("transform", "translate(" + uiConfig.margin.left + "," + uiConfig.margin.top + ")");

        var seriesData =
                withSeriesData(
                        autoGroupOnFirstUpdate(100,
                                withMinMaxKey(withMinMaxOfRow(
                                        groupedBy(d3time([d3.time.monday, d3.time.month]),
                                                withFirstCategories(5, withCategoryExclusion(
                                                        newDataSource(parsedData, "date")
                                                )))))));
        var x = newTimeScale("date").nice().rangeRound([0, uiConfig.width]);
        var y = newScale("value").range([uiConfig.height, 0]);
        var xAxis = newXAxis(svgRoot, x, uiConfig);
        var yAxis = newYAxis(svgRoot, y).label("Amount of commits");
        var lineSeries = newLineSeries(svgRoot, x, y, uiConfig);

        var controlsPanel = newControlsPanel(root, uiConfig);
        addHelpButton(controlsPanel.leftFooter(), svgRoot, uiConfig, description,
                "", {tooltipPad: -20});
        newDropDown(controlsPanel, "Interpolation:", ["basis", "linear"], 0, function(value) {
            lineSeries.setInterpolation(value === "0" ? "basis" : "linear");
        });
        var groupBy = newGroupByDropDown(controlsPanel, seriesData, "Group by:", ["week", "month"]);
        var wordsPanel = newWordsPanel(controlsPanel, lineSeries, seriesData);
        var nothingToShowLabel = newEmptyChartLabel(root, svgRoot, uiConfig);

        seriesData.onUpdate([
            x.update, y.update, groupBy.update,
            lineSeries.update, xAxis.update, yAxis.update, wordsPanel.update,
            nothingToShowLabel.update
        ]);
        x.onUpdate([lineSeries.onXScaleUpdate, xAxis.onXScaleUpdate]);
        lineSeries.onUpdate(wordsPanel.onLineSeriesUpdate);

        seriesData.sendUpdate();
    })();


    function newWordsPanel(root, lineSeries, dataSource) {
        var hiddenCategories = [];

        var wordPanel = root.append("span");
        wordPanel.append("label").html("Committers: ");
        var wordsSpan = wordPanel.append("span");
        wordPanel.append("button").text("Reset").on("click", function() {
            dataSource.clearCategoryExclusions();
        });

        var it = {};
        it.update = function(update) {
            wordsSpan.selectAll(".word").remove();

            var word = wordsSpan.selectAll(".word")
                    .data(update.seriesData).enter()
                    .append("span")
                    .attr("class", "word");

            word.on("mouseover", function(d) {
                lineSeries.setSelectedCategory(d.category);
            });
            word.on("mouseout", function() {
                lineSeries.setSelectedCategory(null);
            });

            word.append("input").attr("type", "checkbox")
                    .attr("checked", function(it) { return _.contains(hiddenCategories, it.category) ? null : ""; })
                    .on("click", function(it) {
                        if (d3.event.altKey) {
                            dataSource.excludeCategory(it.category);
                        } else {
                            var visible = this.checked;
                            lineSeries.setCategoryVisible(it.category, visible);
                            if (visible) {
                                hiddenCategories = _.without(hiddenCategories, it.category);
                            } else {
                                hiddenCategories.push(it.category);
                            }
                        }
                    });
            word.append("label").html(function(d){ return "&nbsp;" + d.category; });
        };
        it.onLineSeriesUpdate = function() {
            hiddenCategories.forEach(function(it) {
                lineSeries.setCategoryVisible(it, false);
            });
        };
        return it;
    }

</script>

        _.extend(this, d3c.seriesCharts());

        var parsedData = parseDateBasedCsv(rawCsv);

        var root = removeChildrenOf(d3.select("#amount-of-commits-by-committer3"));

        var margin = {top: 20, right: 80, bottom: 30, left: 50};
        var uiConfig = {
            width: styleWidthOf(root) - margin.left - margin.right,
            height: 500 - margin.top - margin.bottom,
            margin: margin,
            color: d3.scale.category10()
        };
        var description = helpDescription("What does this chart show?",
                "This chart shows amount of commits by people who committed the most. " +
                "The idea is to see who and when made biggest impact on project. " +
                "(Please avoid this chart if someone might want to attribute amount of commits to personal 'performance'.)" +
                "<br/><strong>Tip:</strong>&nbsp;alt+click checkboxes to exclude committers."
        );

        var svgRoot = root.append("svg")
                .attr("width", uiConfig.width + uiConfig.margin.left + uiConfig.margin.right)
                .attr("height", uiConfig.height + uiConfig.margin.top + uiConfig.margin.bottom)
                .append("g")
                .attr("transform", "translate(" + uiConfig.margin.left + "," + uiConfig.margin.top + ")");

        var seriesData =
                withSeriesData(
                        autoGroupOnFirstUpdate(100,
                                withMinMaxKey(withMinMaxOfRow(
                                        groupedBy(d3time([d3.time.monday, d3.time.month]),
                                                withFirstCategories(5, withCategoryExclusion(
                                                        newDataSource(parsedData, "date")
                                                )))))));
        var x = newTimeScale("date").nice().rangeRound([0, uiConfig.width]);
        var y = newScale("value").range([uiConfig.height, 0]);
        var xAxis = newXAxis(svgRoot, x, uiConfig);
        var yAxis = newYAxis(svgRoot, y).label("Amount of commits");
        var lineSeries = newLineSeries(svgRoot, x, y, uiConfig);

        var controlsPanel = newControlsPanel(root, uiConfig);
        addHelpButton(controlsPanel.leftFooter(), svgRoot, uiConfig, description,
                "", {tooltipPad: -20});
        newDropDown(controlsPanel, "Interpolation:", ["basis", "linear"], 0, function(value) {
            lineSeries.setInterpolation(value === "0" ? "basis" : "linear");
        });
        var groupBy = newGroupByDropDown(controlsPanel, seriesData, "Group by:", ["week", "month"]);
        var wordsPanel = newWordsPanel(controlsPanel, lineSeries, seriesData);
        var nothingToShowLabel = newEmptyChartLabel(root, svgRoot, uiConfig);

        seriesData.onUpdate([
            x.update, y.update, groupBy.update,
            lineSeries.update, xAxis.update, yAxis.update, wordsPanel.update,
            nothingToShowLabel.update
        ]);
        x.onUpdate([lineSeries.onXScaleUpdate, xAxis.onXScaleUpdate]);
        lineSeries.onUpdate(wordsPanel.onLineSeriesUpdate);

        seriesData.sendUpdate();
    })();


    function newWordsPanel(root, lineSeries, dataSource) {
        var hiddenCategories = [];

        var wordPanel = root.append("span");
        wordPanel.append("label").html("Committers: ");
        var wordsSpan = wordPanel.append("span");
        wordPanel.append("button").text("Reset").on("click", function() {
            dataSource.clearCategoryExclusions();
        });

        var it = {};
        it.update = function(update) {
            wordsSpan.selectAll(".word").remove();

            var word = wordsSpan.selectAll(".word")
                    .data(update.seriesData).enter()
                    .append("span")
                    .attr("class", "word");

            word.on("mouseover", function(d) {
                lineSeries.setSelectedCategory(d.category);
            });
            word.on("mouseout", function() {
                lineSeries.setSelectedCategory(null);
            });

            word.append("input").attr("type", "checkbox")
                    .attr("checked", function(it) { return _.contains(hiddenCategories, it.category) ? null : ""; })
                    .on("click", function(it) {
                        if (d3.event.altKey) {
                            dataSource.excludeCategory(it.category);
                        } else {
                            var visible = this.checked;
                            lineSeries.setCategoryVisible(it.category, visible);
                            if (visible) {
                                hiddenCategories = _.without(hiddenCategories, it.category);
                            } else {
                                hiddenCategories.push(it.category);
                            }
                        }
                    });
            word.append("label").html(function(d){ return "&nbsp;" + d.category; });
        };
        it.onLineSeriesUpdate = function() {
            hiddenCategories.forEach(function(it) {
                lineSeries.setCategoryVisible(it, false);
            });
        };
        return it;
    }
